        "descriptionLocalized": {
            "guid": "000000010E7F",
            "en-US": "Attaches one Player (the Child) to another Player (the Parent). Once attached, the Child will be unable to move freely until detached or teleported away. Multiple children may be attached to the same Parent (but not vice versa).",
            "de-DE": "Bindet einen Spieler ([Child]) an einen anderen Spieler ([Parent]). Anschließend kann sich das [Child] nicht mehr unabhängig bewegen, bis die Bindung wieder gelöst oder der Spieler wegteleportiert wird. Mehrere [Children] können an einen [Parent] gebunden werden (aber nicht umgekehrt).",
            "es-ES": "Acopla un jugador (elemento secundario) a otro (elemento primario). Una vez acoplados, el elemento secundario no podrá moverse con libertad hasta que se desacople o se teletransporte a otro lugar. Se pueden acoplar varios elementos secundarios a un mismo elemento primario (pero no al revés).",
            "es-MX": "Une a un jugador (el Hijo) a otro jugador (el Padre). Una vez unidos, el Hijo no podrá moverse con libertad hasta separarse o ser transportado a otra ubicación. Se pueden unir varios hijos a un mismo Padre, pero no al revés.",
            "fr-FR": "Attache un joueur (l’enfant) à un autre joueur (le parent). Une fois attaché, l’enfant ne peut plus se déplacer librement ou se téléporter jusqu’à ce qu’il soit détaché. Plusieurs enfants peuvent être attachés au même parent (mais pas l’inverse).",
            "it-IT": "Lega un Giocatore (il Figlio) a un altro Giocatore (il Genitore). Una volta legato, il Figlio non potrà muoversi liberamente finché non si separerà o sarà teletrasportato altrove. È possibile legare più Figli allo stesso Genitore, ma non viceversa.",
            "ja-JP": "1人のプレイヤー（子）を他のプレイヤー（親）にくっつける。くっつけられた子プレイヤーは離されるかテレポートされるまで自由に移動できなくなる。同じ親プレイヤーに複数の子プレイヤーをくっつけることができる（同じ子に複数の親をくっつけることはできない）",
            "ko-KR": "플레이어(자녀)를 다른 플레이어(부모)와 연결합니다. 연결된 자녀(Child)는 분리되거나 순간이동으로 멀어지기 전에 자유롭게 움직일 수 없습니다. 다수의 자녀를 같은 부모(Parent)에 연결할 수 있지만 그 반대는 불가능합니다.",
            "pl-PL": "Przyłącza jednego gracza „Child” (Potomna) do drugiego „Parent” (Nadrzędna). Po dołączeniu, potomna nie będzie mogła się swobodnie poruszać, dopóki nie zostanie odłączona lub teleportowana. Do tej samej nadrzędnej można przyłączyć kilka potomnych (ale nie na odwrót).",
            "pt-BR": "Une um Jogador (o Filho) a outro Jogador (o Pai). Uma vez unido, o Filho não poderá se mover livremente até ser separado ou teleportado. Vários Filhos podem ser unidos ao mesmo Pai (mas não o contrário).",
            "ru-RU": "Привязывает одного игрока (ведомого) к другому игроку (ведущему). После привязки ведомый не сможет свободно передвигаться, пока не будет откреплен или телепортирован. К одному игроку-ведущему можно привязать несколько ведомых (но не наоборот).",
            "zh-CN": "将一名玩家（子玩家）与另一名玩家（父玩家）绑定。绑定之后，除非解除绑定或传送离开，否则子玩家无法自由移动。多个子玩家可以绑定至同一名父玩家，但反之则不成立。"
        },
