            "guid": "00000001130E",
            "en-US": "Starts modifying the size of a Player or Players (including model, movement collision, hit detection, and certain abilities). Note that large players placed into complex environments will severely impact server load, so consider also applying the Disable Movement Collision With Environment action.",
            "de-DE": "Beginnt, die Größe eines oder mehrerer Spieler zu modifizieren (einschließlich des Modells, der Bewegungskollision, der Treffererkennung und bestimmter Fähigkeiten). Hinweis: Große Spieler, die in komplexen Umgebungen platziert werden, beeinträchtigen die Serverauslastung stark. Du kannst dem entgegenwirken, indem du auch die Aktion [Disable Movement Collision With Environment] anwendest.",
            "es-ES": "Comienza a modificar el tamaño de un jugador o varios jugadores (incluyendo modelo, colisión de movimiento, detección de impactos y determinadas habilidades). La presencia de jugadores de gran tamaño en entornos complejos afectará mucho a la carga del servidor, por lo que conviene plantearse aplicar la acción «Disable Movement Collision With Environment».",
            "es-MX": "Comienza a modificar el tamaño del jugador o jugadores (incluye el modelo, colisión de movimiento, detección de impactos y ciertas habilidades). Ten en cuenta que los jugadores de gran tamaño ubicados en entornos complejos afectarán de forma drástica el uso del servidor, así que también considera aplicar la acción Deshabilitar colisión de movimiento con entorno.",
            "fr-FR": "Commence à modifier la taille d’un ou de plusieurs joueurs (y compris le modèle, la collision des mouvements, la détection des coups et certaines capacités). Notez que les grands joueurs placés dans des environnements complexes auront un impact important sur le chargement des serveurs, pensez donc à appliquer également l’action « Désactiver la collision des mouvements avec l’environnement ».",
            "it-IT": "Inizia a modificare la dimensione di un Giocatore o di più Giocatori (inclusi modello, collisione di movimento, individuazione dei colpi e alcune abilità). Attenzione: giocatori di grandi dimensioni posti in ambienti complessi hanno un impatto importante sul carico del server, perciò consigliamo di applicare l'azione Disable Movement Collision With Environment.",
            "ja-JP": "プレイヤー（モデル、移動時の衝突判定、命中判定、特定アビリティを含む）のサイズの変更を開始。複雑な環境に置かれたサイズの大きなプレイヤーはサーバーに多大な負荷をもたらすため、「移動時の環境との衝突判定を無効化」アクションの適用が推奨される",
            "ko-KR": "플레이어의 크기 변경을 시작합니다(모델, 이동 시 충돌, 충돌 검출 및 특정 기술 포함). 복잡한 환경에 대형 플레이어가 배치되면 서버 부하가 현저히 증가하므로 Disable Movement Collision With Environment 액션의 적용도 고려해야 합니다.",
            "pl-PL": "Zaczyna modyfikować rozmiar gracza lub graczy (w tym model, kolizję ruchu, wykrywanie trafień i niektóre zdolności). Uwaga: duże postacie umieszczone w skomplikowanych środowiskach poważnie wpłyną na obciążenie serwów, dlatego zalecane jest zastosowanie działania „Disable Movement Collision With Environment” (Wyłącz kolizje z otoczeniem w ruchu).",
            "pt-BR": "Começa a modificação de tamanho de um Jogador ou Jogadores (inclusive modelo, colisão de movimento, detecção de acerto e determinadas habilidades). Observe que jogadores grandes colocados em ambientes complexos terão um impacto severo na capacidade do servidor, por isso considere também aplicar a ação Desabilitar Colisão de Movimento com Ambiente.",
