                    "en-US": "The color of the beam effect to be created. If a particular team is chosen, the effect will either be red or blue, depending on whether the team is hostile to the viewer. Does not apply to sound effects.  Only the \"Good\" and \"Bad\" beam effects can have color applied. Does not support Custom Color.",
