                    "it-IT": "Il colore dell'effetto del raggio da creare. Se viene scelta una squadra specifica, l'effetto sarà rosso o blu, a seconda che la squadra sia ostile o meno allo spettatore. Non si applica agli effetti sonori. Solo gli effetti \"Good\" e \"Bad\" possono avere un colore. Non supporta la personalizzazione dei colori.",
                    "ja-JP": "作成されるビーム・エフェクトの色。特定のチームが選ばれた場合、そのチームが観戦者の敵側かどうかによって、エフェクトは赤か青のいずれかになる。効果音には適用されない。「プラス効果」「マイナス効果」のあるビーム・エフェクトにのみ適用される。カスタム・カラーには対応しない",
                    "ko-KR": "생성될 광선 효과의 색상입니다. 특정 팀을 선택한 경우, 해당 팀이 보는 사람에게 적인지 여부에 따라 빨강 또는 파랑으로 효과 색상이 설정됩니다. 효과음에는 적용되지 않습니다. 오직 \"Good\", 그리고 \"Bad\" 광선 효과에만 색상이 적용됩니다. 사용자 지정 색깔을 지원하지 않습니다.",
                    "pl-PL": "Kolor efektu, który zostanie stworzony. Jeśli wybrano konkretną drużynę, efekt będzie albo czerwony, albo niebieski, zależnie od tego, czy drużyna była wroga wobec obserwatora. Nie obejmuje efektów dźwiękowych. Kolor można nałożyć tylko na „pozytywne” lub „negatywne” efekty wiązek. Nie obsługuje opcji „Custom Color” (Kolorów niestandardowych).",
                    "pt-BR": "A cor do efeito de feixe a ser criado. Se uma equipe em particular for escolhida, o efeito será vermelho ou azul, o que indica se a equipe é hostil ou não ao espectador. Não se aplica a efeitos sonoros. Só é possível alterar a cor dos efeitos de feixe \"Bom\" e \"Mau”. Incompatível com Cor Personalizada.",
                    "ru-RU": "Цвет создаваемого эффекта луча. Если выбрана конкретная команда, цвет будет красным или синим в зависимости от того, враждебна ли команда по отношению к смотрящему. Неприменимо к звуковым эффектам. Цвет можно выбрать только для эффектов с параметрами [Good] или [Bad]. Нельзя установить свой цвет с помощью [Custom Color].",
                    "zh-CN": "所创建效果的颜色。如果选择了一支队伍，此效果将显示为红色或蓝色，根据观察者是否与这支队伍敌对决定。不会影响音效，只会影响“有益”或“有害”的光束效果。不支持自定义颜色。"
