        "descriptionLocalized": {
            "guid": "00000000CA6B",
            "en-US": "Adds a new bot to the specified slot on the specified team so long as the slot is available. This bot will only move, fire, or use abilities if executing Workshop actions. Extra dummy bots may be created if the corresponding Workshop Extension is enabled.",
            "de-DE": "Platziert einen neuen Bot im festgelegten Slot im festgelegten Team, wenn dieser Slot verfügbar ist. Der Bot kann sich nur bewegen, angreifen oder Fähigkeiten einsetzen, wenn er Workshop-Aktionen ausführt. Zusätzliche Bots können erschaffen werden, wenn die entsprechende Workshop-Erweiterung aktiviert ist.",
            "es-ES": "Añade un nuevo robot a la ranura especificada del equipo especificado siempre que la ranura esté disponible. Este robot solo se moverá, disparará y usará habilidades si ejecuta acciones del Taller. Se pueden crear más robots si está activada la extensión correspondiente del Taller.",
            "es-MX": "Agrega un nuevo robot al puesto especificado en el equipo especificado siempre que el puesto esté disponible. Este robot solo se moverá, disparará o usará habilidades si se ejecutan acciones del Workshop.",
            "fr-FR": "Ajoute une nouvelle I.A. à un emplacement spécifique dans l’équipe choisie tant que l’emplacement est libre. Cette I.A. ne pourra se déplacer, tirer, ou utiliser des capacités que si elle exécute des actions de la Forge. Les I.A. supplémentaires peuvent être créées si l’extension de la Forge correspondante est activée.",
            "it-IT": "Aggiunge un nuovo bot allo slot specifico alla squadra specifica finché lo slot è disponibile. Questo bot si muoverà, sparerà e userà le abilità solo se segue le azioni del Workshop. È possibile creare bot di prova aggiuntivi se è attiva l'estensione Workshop corrispondente.",
            "ja-JP": "スロットが空いていれば、指定されたチームの指定されたスロットに新しいボットを1体追加する。このボットは移動、射撃のみを行い、ワークショップのアクションを実行している場合はアビリティを使用する。対応するワークショップの拡張要素が有効な場合はさらにダミーボットが作成できる",
            "ko-KR": "새로운 봇을 특정 팀의 특정 슬롯에 추가합니다. 사용 가능한 슬롯이 있어야 합니다. 워크샵 액션을 실행할 경우 해당 봇은 이동, 발사, 기술 사용만 가능합니다. 해당하는 워크샵 확장이 활성화된 경우 추가 더미 봇이 생성될 수 있습니다.",
            "pl-PL": "Dodaje nowego bota do określonego miejsca w wyznaczonej drużynie, o ile miejsce jest dostępne. Bot będzie się tylko poruszać, strzelać lub używać zdolności przy wykonywaniu działań z Warsztatu. Dodatkowe atrapy botów mogą powstawać, jeśli odpowiednie rozszerzenie Warsztatu jest włączone.",
            "pt-BR": "Adiciona um bot ao espaço especificado na equipe escolhida se ele estiver disponível. Ele só vai andar, atacar e usar habilidades ao executar ações do Workshop. Bots adicionais poderão ser criados se Extensões do Workshop adequadas estiverem ativas.",
            "ru-RU": "Добавляет новый ИИ в указанную ячейку указанной команды, если эта ячейка свободна. Этот ИИ будет передвигаться, стрелять и применять способности, только выполняя действия, описанные в «Мастерской». Для создания дополнительных манекенов необходимо подключить соответствующее расширение «Мастерской».",
            "zh-CN": "在指定队伍的指定栏位添加一个新的机器人（只要该空位可用）。机器人只能移动与射击，或根据地图工坊的动作设置使用技能。启用相应地图工坊扩展可额外创建更多机器人。"
        },
