            "es-MX": "Crea una entidad de ícono dentro del mundo. Esta entidad de ícono permanecerá intacta hasta que sea destruida. Para obtener una referencia a esta entidad, utiliza el valor Última entidad creada. Esta acción no podrá realizarse si se han creado demasiadas entidades.",
            "fr-FR": "Crée une entité d’icône dans le monde. Cette entité d’icône persiste jusqu’à sa destruction. Pour obtenir une référence vers cette entité, utilisez la valeur « Dernière entité créée ». Cette action échouera si trop d’entités ont été créées.",
            "it-IT": "Crea un'entità icona nel mondo di gioco. Tale entità icona esisterà finché non verrà distrutta. Per ottenere un riferimento all'entità, usa il Valore Last Created Entity. Questa Azione non andrà a buon fine se troppe entità sono già state create.",
            "ja-JP": "ワールド内のアイコン・エンティティを作成する。このアイコン・エンティティは破棄されるまで表示される。このエンティティへの参照を取得するには、「最新のエンティティ」の値を使用する。作成されたエンティティが多すぎると、このアクションは実行できない",
            "ko-KR": "월드 내에 아이콘 개체를 생성합니다. 이 아이콘 개체는 제거하기 전까지 지속됩니다. 이 개체를 참조하려면 Last Created Entity 값을 사용하면 됩니다. 개체가 너무 많이 생성될 경우 이 액션이 실패할 수 있습니다.",
            "pl-PL": "Tworzy encję symbolu w świecie, która będzie się utrzymywać do jej usunięcia. Aby pozyskać odniesienie do tej encji, użyj wartości „Last Created Entity” (Ostatnia stworzona encja). To działanie nie powiedzie się, jeśli stworzono zbyt dużo encji.",
            "pt-BR": "Cria uma entidade de ícone no mundo. Essa entidade de ícone persistirá até ser destruída. Para obter uma referência a essa entidade, use o Valor da Entidade Criada por Último. Não será possível realizar essa Ação se entidades demais tiverem sido criadas.",
            "ru-RU": "Создает экземпляр значка в игровом мире, существующий до разрушения. Для получения ссылки на этот экземпляр используйте значение [Last Created Entity]. Если создано слишком много экземпляров, действие завершится неудачей.",
